static const char __pyx_k_Migdal_Insurance_Financial_Holdi[] = "Migdal Insurance & Financial Holdings Ltd. Sells 750,000 Shares of Talkspace, Inc. (NASDAQ:TALK)\nMigdal Insurance & Financial Holdings Ltd. cut its stake in shares of Talkspace, Inc. (NASDAQ:TALK - Free Report) by 37.5% in the fourth quarter, according to the company in its most recent disclosure with the Securities and Exchange Commission (SEC). The fund owned 1,250,000 shares of the company's stock after selling 750,000 shares during the period. Migdal Insurance & Financial Holdings Ltd. owned approximately 0.75% of Talkspace worth $3,175,000 as of its most recent SEC filing.\n\n\nOther institutional investors and hedge funds have also made changes to their positions in the company. NVP Associates LLC purchased a new position in shares of Talkspace in the fourth quarter valued at approximately $8,973,000. Vanguard Group Inc. boosted its holdings in Talkspace by 29.5% in the third quarter. Vanguard Group Inc. now owns 5,740,353 shares of the company's stock valued at $11,194,000 after purchasing an additional 1,307,834 shares during the period. Goldman Sachs Group Inc. grew its stake in Talkspace by 44.8% during the 1st quarter. Goldman Sachs Group Inc. now owns 5,081,589 shares of the company's stock worth $8,842,000 after purchasing an additional 1,571,383 shares in the last quarter. AWM Investment Company Inc. increased its holdings in Talkspace by 94.2% during the 3rd quarter. AWM Investment Company Inc. now owns 2,287,724 shares of the company's stock worth $4,461,000 after purchasing an additional 1,109,876 shares during the period. Finally, Alyeska Investment Group L.P. raised its position in Talkspace by 87.6% in the 4th quarter. Alyeska Investment Group L.P. now owns 1,594,800 shares of the company's stock valued at $973,000 after purchasing an additional 744,800 shares in the last quarter. 57.37% of the stock is owned by hedge funds and other institutional investors.\n\n\nA shocking leak has revealed tech giant Microsoft's plans to add crypto support to ""future products. If the plans in these leaked internal documents pan out, we could see prices skyrocket for Bitcoin, Ethereum, XRP and MORE\342\200\246 The coupling of gaming and cryptocurrency could absolutely transform digital finance as we know it in 2024.\nClaim your free seat by clicking here now.\n\nTalkspace Stock Down 3.0 %\nTALK stock traded down $0.09 during trading on Wednesday, hitting $2.94. The company had a trading volume of 916,795 shares, compared to its average volume of 1,258,979. The firm has a 50-day moving average price of $3.09 and a 200-day moving average price of $2.47. The firm has a market cap of $496.58 million, a PE ratio of -25.08 and a beta of 1.26. Talkspace, Inc. has a 1-year low of $0.74 and a 1-year high of $3.92.\nTalkspace (NASDAQ:TALK - Get Free Report) last announced its quarterly earnings data on Thursday, February 22nd. The company reported ($0.01) EPS for the quarter, topping analysts' consensus estimates of ($0.04) by $0.03. Talkspace had a negative net margin of 12.78% and a negative return on equity of 16.06%. The company had revenue of $42.42 million during the quarter, compared to the consensus estimate of $38.30 million. During the same quarter in the prior year, the firm earned ($0.08) EPS. Sell-side analysts anticipate that Talkspace, Inc. will post -0.03 earnings per share for the current year.\nWall Street Analysts Forecast Growth\nA number of research analysts recently issued reports on TALK shares. TheStreet upgraded shares of Talkspace from a \"d\" rating to a \"c-\" rating in a research note on Thursday, February 22nd. Barclays raised their price objective on shares of Talkspace from $2.50 to $3.00 and gave the stock an \"equal weight\" rating in a report on Friday, February 23rd.\nCheck Out Our Latest Research Report on TALK\nTalkspace Company Profile (Free Report)\nTalkspace, Inc operates as a virtual behavioral healthcare company in the United States. The company offers psychotherapy and psychiatry services ""through its platform to individuals, enterprises, and health plans and employee assistance programs. It provides text, audio, and video-based psychotherapy from licensed therapists.\nIris Energy Limited development of green energy-driven data centres in Canada\n\nOur Vancouver office is working alongside the firm\342\200\231s Calgary office to advise Australia-based Iris Energy Limited on the development of green energy-driven data centres in Canada. Iris Energy is a bitcoin mining business powered by renewable energy, with multiple data centre sites in British Columbia powered by renewable hydroelectric electricity. Iris Energy has a portfolio of development projects across Canada, the United States and APAC. \n\n\nOur work includes advising on all aspects of real estate (e.g., land purchases, leases, contaminated site remediation advice, and management of environmental liabilities), business agreements (e.g., equipment leases, equipment finance, equipment procurement agreements, engineering agreements), other land and power arrangements (e.g., utility interconnection and power supply agreements, regulatory requirements) and IPO support. \n\n\nThis mandate reflects a significant footprint across British Columbia, with 3 existing projects totalling 160MW and major growth across North America. The development of data centres is a fast-growing area for Canadian real estate groups, not least because the British Columbia government has taken major steps to attract investment. Such developments present unique challenges and requirements. With bitcoin mining often being criticised for its substantial energy use, it is noteworthy that our client is focusing on developing data centres powered by renewables.\n\nStock Traders Buy High Volume of Iris Energy Call Options (NASDAQ:IREN)\nIris Energy Stock Performance\nIREN opened at $4.35 on Wednesday. The company\342\200\231s 50-day simple moving average is $5.67 and its two-hundred day simple moving average is $4.94. Iris Energ""y has a 52-week low of $2.79 and a 52-week high of $9.69.\nIris Energy (NASDAQ:IREN \342\200\223 Get Free Report) last issued its quarterly earnings data on Thursday, February 15th. The company reported ($0.07) earnings per share for the quarter. The company had revenue of $42.57 million for the quarter, compared to the consensus estimate of $37.58 million. On average, sell-side analysts predict that Iris Energy will post 0.08 earnings per share for the current fiscal year.\nHedge Funds Weigh In On Iris Energy\nA number of institutional investors and hedge funds have recently modified their holdings of the company. Mirae Asset Global Investments Co. Ltd. boosted its holdings in shares of Iris Energy by 52.4% in the fourth quarter. Mirae Asset Global Investments Co. Ltd. now owns 1,037,420 shares of the company\342\200\231s stock worth $7,418,000 after buying an additional 356,752 shares during the last quarter. Vontobel Holding Ltd. bought a new position in Iris Energy in the third quarter worth approximately $104,000. Van ECK Associates Corp boosted its stake in shares of Iris Energy by 19.7% during the 3rd quarter. Van ECK Associates Corp now owns 1,117,769 shares of the company\342\200\231s stock worth $4,147,000 after acquiring an additional 184,039 shares during the last quarter. Tucker Asset Management LLC purchased a new position in shares of Iris Energy during the 3rd quarter worth $47,000. Finally, Exchange Traded Concepts LLC grew its position in shares of Iris Energy by 47.1% during the 4th quarter. Exchange Traded Concepts LLC now owns 613,818 shares of the company\342\200\231s stock valued at $4,389,000 after acquiring an additional 196,635 shares during the period. 41.08% of the stock is currently owned by hedge funds and other institutional investors.\nAnalyst Ratings Changes\nA number of analysts have recently commented on the company. B. Riley dropped their price target on Iris Energy from $10.00 to $9.50 and set a \342\200\234buy\342\200\235 rating"" on the stock in a research report on Friday, March 15th. Canaccord Genuity Group reiterated a \342\200\234buy\342\200\235 rating and set a $9.00 price objective on shares of Iris Energy in a research note on Thursday, March 28th. Cantor Fitzgerald reissued an \342\200\234overweight\342\200\235 rating and issued a $10.00 target price on shares of Iris Energy in a research note on Thursday, March 28th. Finally, HC Wainwright reaffirmed a \342\200\234buy\342\200\235 rating and issued a $10.00 price target on shares of Iris Energy in a research report on Tuesday, April 2nd. Five analysts have rated the stock with a buy rating, According to data from MarketBeat, Iris Energy currently has a consensus rating of \342\200\234Buy\342\200\235 and an average target price of $12.00.\nCheck Out Our Latest Research Report on Iris Energy\nAbout Iris Energy\n(Get Free Report)\nIris Energy Limited owns and operates bitcoin mining data centers. The company was incorporated in 2018 and is headquartered in Sydney, Australia.\nFifth Third stock gains after strong quarterly guidance, Q1 earnings beat\nFifth Third Bancorp (NASDAQ:FITB) stock advanced 4% in Friday morning trading after delivering strong guidance for Q2 and better-than-forecast Q1 earnings.\nThe Cincinnati, Ohio-based lender expects Q2 2024 total revenue rising about 1% sequentially from $2.18B in Q1, implying Q2 revenue of ~$2.20B (vs. $2.13B consensus). Net interest income is seen stable to up 1% in Q2 from $1.39B in Q1, implying $1.39B-$1.40B (vs. $1.39B Visible Alpha consensus).\nQ2 noninterest income is anticipated to rise 2%-4% from $717M in Q1, implying $731.3M-$745.7M. Noninterest expense is projected to retreat about 6% from Q1's $1.30B, implying $1.22B.\nFor Q1 2024, the company turned in adjusted EPS of $0.76 (excluding a negative $0.06 impact from certain items), surpassing the $0.72 average analyst estimate. The latest figure compares with GAAP EPS of $0.72 in Q4 2023 and $0.78 in the year-earlier period.\nNet ""interest income (fully taxable equivalent) was $1.39B (vs. $1.38B Visible Alpha consensus), down from $1.42B in the prior quarter and $1.52B a year before.\nNoninterest income fell to $710M from $744M in Q4 2023 and rose from $696M in Q1 2023.\nProvision for credit losses of $94M climbed from $55M in Q4 2023 and slid from $164M a year ago.\nTotal noninterest expense of $1.34B decreased 8% Q/Q and gained 1% Y/Y.\nAverage portfolio loans and leases of $117.3B slipped 1% Q/Q; average deposits of $168.1B also edged down 1% sequentially.\nAmerican Express (AXP) Earnings Announcement - Will Credit Card Giant Surpass Expectations?\nAmerican Express Company (AXP - Get Rating) will unveil its first-quarter results on April 19. Wall Street anticipates the credit card giant to post higher revenue and earnings in the first quarter. With AXP\342\200\231s earnings expected shortly, I have discussed why waiting for an opportune entry point in the stock could be wise.\nFor the first quarter, AXP\342\200\231s EPS and revenue are expected to increase 24.2% and 10.5% year-over-year to $2.98 and $15.79 billion, respectively. The company achieved record revenues and profits in 2023 and added 12.2 million new proprietary cards last year, bringing the total number of cards-in-force issued on its global network to over 140 million.\nFor fiscal 2024, AXP has guided revenue growth of 9% to 11% and expects EPS of between $12.65 and $13.15. The company aims to continue achieving revenue growth of 10% plus and mid-teens EPS growth in the future. AXP\342\200\231s stock has gained 41% over the past six months and 33% over the past year, closing the last trading session at $217.67.\nHere\342\200\231s what you might want to consider ahead of its upcoming earnings release:\nRobust Financials\nAXP\342\200\231s total revenues net of interest expense for the fiscal fourth quarter ended December 31, 2023, rose 11.4% year-over-year to $15.80 billion. Its net interest income rose 30.7% over the prior-year"" quarter to $3.60 billion. The company\342\200\231s net income attributable to common shareholders increased 23.2% year-over-year to $1.90 billion. Also, its EPS came in at $2.62, representing an increase of 26.6% year-over-year.\nFor the fiscal year ended December 31, 2023, AXP\342\200\231s total revenues net of interest expense increased 14.5% year-over-year to $60.52 billion. Its net interest income rose 32.7% over the prior-year period to $13.13 billion. The company\342\200\231s net income attributable to common shareholders increased 11.5% year-over-year to $8.25 billion. Also, its EPS came in at $11.21, representing an increase of 13.8% year-over-year.\nFavorable Analyst Estimates\n2024 STOCK MARKET OUTLOOK\nAnalysts expect AXP\342\200\231s fiscal 2024 EPS and revenue to increase 14.2% and 9.4% year-over-year to $12.81 and $66.22 billion, respectively. Its fiscal 2025 EPS and revenue are expected to increase 15% and 8.6% year-over-year to $14.73 and $71.92 billion, respectively.\nSimilarly, analysts expect AXP\342\200\231s EPS and revenue for the quarter ending June 30, 2024, to increase 12% and 9.8% year-over-year to $3.24 and $16.53 billion, respectively.\nMixed Profitability\nAXP\342\200\231s 15.06% trailing-12-month net income margin is 36% lower than the 23.52% industry average. Its 55.04% trailing-12-month gross profit margin is 7.7% lower than the 59.66% industry average.\nOn the other hand, AXP\342\200\231s 31.28% trailing-12-month Return on Common Equity is 187.7% higher than the 10.87% industry average. Furthermore, the stock\342\200\231s 3.21% trailing-12-month Return on Total Assets is 195.3% higher than the industry average of 1.09%. Also, its 0.23x trailing-12-month asset turnover ratio is 7.5% higher than the industry average of 0.21x.\nMixed Valuation\nIn terms of forward non-GAAP PEG, AXP\342\200\231s 1.29x is 6.1% higher than the 1.21x industry average. Its 17x forward non-GAAP P/E is 72.1% higher than the 9.88x industry average. Likewise, it""s 5.04x forward Price/Book is 406.8% higher than the 0.99x industry average.\nOn the other hand, in terms of forward Price/Sales, AXP\342\200\231s 2.37x is 0.8% lower than the 2.39x industry average.\nPOWR Ratings Reflect Uncertainty\nAXP has an overall rating of C, equating to a Neutral in our POWR Ratings system. The POWR Ratings are calculated by considering 118 different factors, each weighted to an optimal degree.\nOur proprietary rating system also evaluates each stock based on eight distinct categories. AXP has a C grade for Value, which is consistent with its mixed valuation. It has a C grade for Stability, in sync with its 1.23 beta.\nAXP\342\200\231s mixed profitability justifies its C grade for Quality.\nAXP is ranked #19 out of 45 stocks in the Consumer Financial Services industry. Click here to access AXP\342\200\231s Growth, Momentum, and Sentiment ratings.\nBottom Line\nAfter ending fiscal 2023 on a solid note, AXP remains firmly positioned to achieve its long-term annual revenue growth of more than 10% and mid-teens EPS growth. As consumer spending continues to remain robust, the company is expected to see strong growth in billings, new account acquisitions, and processed volumes in the first quarter.\nHowever, loans and cardmember receivables are expected to moderate through the rest of the year. Net interest income growth is also expected to moderate in fiscal 2024. Moreover, as credit card delinquencies continue to rise, write-offs are expected to increase along with higher reserve build-ups.\nGiven its mixed profitability, valuation, and stability, it could be wise to wait for a better entry point in the stock.\nHow Does American Express Company (AXP) Stack Up Against Its Peers?\nAXP has an overall POWR Rating of C, equating to a Neutral rating. You may check out these A and B-rated stocks within the Consumer Financial Services industry: Qifu Technology, Inc. (QFIN - Get Rating), Atlanticus Holdings Corporation (ATLC - Get Rating), and EZCORP, In""c. (EZPW - Get Rating). For exploring more Buy-rated Comsumer Financial Services stocks, click here.\nWhat To Do Next?\nDiscover 10 widely held stocks that our proprietary model shows have tremendous downside potential. Please make sure none of these \342\200\234death trap\342\200\235 stocks are lurking in your portfolio:\n";
