static const char __pyx_k_Root_Inc_Promising_Embedded_Stra[] = "Root, Inc.: Promising Embedded Strategy With Potential Nationwide Expansion\nMay 06, 2024 8:05 AM ETRoot, Inc. (ROOT) Stock12 Comments\n\nTech and Growth\n3.16K Followers\nFollow\nSummary\nRoot, Inc. is a leading auto insurtech company, leveraging data science and technology to improve underwriting performance.\nDespite weak overall share performance since going public, Root has seen significant growth over the past year, with its stock price increasing almost 10x.\nRoot's strong financial performance, including revenue growth and narrowing net losses, suggests potential for continued growth and profitability.\n\nLuis Alvarez/DigitalVision via Getty Images\nRoot, Inc. (NASDAQ:ROOT) is an auto insurtech company, leveraging data science and tech platform to drive underwriting performance. ROOT also claims to be the largest auto insurtech player by premium.\nOverall share performance since going public in 2020 has been weak, with ROOT currently trading at $56, down almost -87% since then. ROOT could have been performing much worse, had it not seen strong momentum over the past year. Just May last year, ROOT was still trading at $5 price level, meaning that it is now up almost 10x today over the past year.\nI rate ROOT stock a buy. My 1-year price target of $74.7 per share projects a 32% upside. I believe ROOT may continue to see strong tailwinds into FY 2024, driven by its embedded platform distribution strategy that should also allow it to unlock further growth through nationwide expansion in the future.\nFinancial Reviews\n\nycharts\nFundamentals had been weak in the last two years, when ROOT saw overall decline in business growth and also profitability. However, ROOT appears to have been on a rebound since FY 2023, when it posted a revenue growth of over 46% YoY. It maintained this trend in the most recent quarter, Q1 2024. In Q1, ROOT delivered a revenue of almost $255 million, which was already a staggering 263% YoY growth. Though this was primarily due to the eas""ier comparison, considering the considerable downturn last year, when policies in force trended lower because ROOT reduced marketing expense.\nNet losses have also continued to narrow as of Q1, with ROOT realizing a GAAP net loss margin of -2.4%, closing in the gap to breakeven. In fact, this has been the closest ROOT has been to achieving breakeven over the past five years on a quarterly basis. The improved bottom-line performance seems to have helped improve operating cash flow (OCF) generation as well. ROOT has consistently delivered positive OCF since two quarters ago, and it continued to maintain such a trend in Q1, when it delivered over $14 million in OCF. This seems to also have helped create a slight uptick in liquidity. ROOT ended Q1 with over $856 million of cash and short-term investments, up over 1% since last quarter.\nOut of that $856 million of liquidity, cash and cash equivalents actually declined slightly to $640 million. Yet, ROOT also invested $59 million of its cash into investments. As such, AFS (Available-For Sale) securities, short-term investments, and other investments ended up increasing to $220 million for the quarter, up by over 28% YoY, driving up overall liquidity position.\nCatalyst\nI believe ROOT is well positioned to maintain a decent growth performance and also a positive trend in profitability.\n\ncompany presentation\nI think that the key catalyst here would be the increased effort to diversify its distribution through embedding its technology-driven products into car-buying platforms such as Carvana, which already possess a large client base. Effectively, this allows for more effective GWP (Gross Written Premium) growth through seamlessly adding insurance-buying activity into a typical car-buying journey, in my opinion. Given the success so far in driving sustainable growth in Q1, as demonstrated by the steep downtrend in gross loss ratio and also 68% YoY growth in new writings from partnerships, I believe ROOT is in a good pos""ition to scale up further.\n\ncompany presentation\nIn my view, one of the key growth levers here would be nationwide expansion. Today, as commented by the management, ROOT has only been operating in 34 states, suggesting that there is significant room for expansion:\nAnd we believe that we\342\200\231ve got ample growth levers that we can pull. Currently, we\342\200\231re only in 34 states. We would like to be national at some point and we\342\200\231re continuing to invest in our differentiated distribution. So, our partnership channel does continue to grow.\nSource: Q1 earnings call.\nRisk\nAs anticipated by the management, GWP will decline in Q2 relative to Q1, driven by seasonality and also changes in the competitive environment. GWP remains a key driver for growth for ROOT, and declining GWP could signal potential top-line growth slowdown that may trigger sell-offs.\nNonetheless, in my view, this may also suggest that the market\342\200\231s expectation of ROOT achieving a net profit breakeven will consequently increase, especially given the fact that ROOT will not be spending aggressively just to grow its GWP. As a result, ROOT will also need to deliver stronger profitability profile in Q2 and beyond to somehow offset the lower growth. Otherwise, share performance could potentially suffer, in my view.\nIn fact, I would also expect ROOT to take the opportunity here to aim for a breakeven, since it is typical for ROOT to also spend higher on marketing in Q1, relative to other quarters:\nI\342\200\231d say we are always looking at the competitive environment and monitoring the competitive environment, as well as seasonality and we do know that the first quarter, you see more auto insurance shopping and so you should expect that to accelerate sales and marketing spend in the first quarter relative to other quarters.\nSource: Q1 earnings call.\nIn my view, stronger profitability performance in Q2 should also help reduce concerns regarding competition, which is exp""ected to become more intense in the FY. The online auto insurtech space has gotten crowded, with players like Metromile, Branch, or Clearcover competing for market share.\nValuation / Pricing\nMy target price for ROOT is driven by the following assumptions for the bull vs bear scenarios of the FY 2024 projection:\nBull scenario (50% probability) assumptions - I expect revenue to grow 119% YoY to $1 billion, in line with the market\342\200\231s consensus. I assume forward P/S to expand slightly to 1.4x, implying a share price appreciation to $93.\nBear scenario (50% probability) assumptions - ROOT to deliver FY 2024 revenue of $700 million, a 53% YoY growth, but is still way lower than the market\342\200\231s consensus low-end target of $997 million. I assign ROOT a forward P/S of 1.2x, where it is trading today, projecting a sideways price action within $56 price level.\n\nown analysis\nConsolidating all the information above into my model, I arrived at an FY 2024 weighted target price of $74.7 per share, projecting an over 32% upside. I would assign the stock a buy rating.\nMy assumption of 50-50 for bull and bear scenarios is based on my belief that the competitive environment still presents a bit of uncertainty despite the relatively strong tailwinds today. Though the management has not issued a FY guidance, the market\342\200\231s consensus seems to expect a very strong outperformance continuing on in FY 2024. I believe the $74.7 price target is also realistic, since ROOT also already saw that level this year. In fact, ROOT\342\200\231s YTD high was $83 per share, which it last saw in early April.\nConclusion\nROOT is an insurtech company that has been on a rebound since seeing decline in business in the past two years. I think that the embedded platform distribution strategy should allow ROOT to unlock efficient growth opportunities through providing better insurance-buying experience. Moreover, given the strong unit economics today, ROOT is in a good position ""to scale up nationwide, where there is still plenty of room for growth there. My price target of $74.7 projects a 32% 1-year upside. I rate the stock a buy.\nLX Oncology Appoints Allison Dillon as Chief Business Officer\nMay 07, 2024 09:00 ET| Source: ALX Oncology\nFollow\n\nShare\n\n\n\n\n\n\n\n\n\n\n\n\n\nSOUTH SAN FRANCISCO, Calif., May 07, 2024 (GLOBE NEWSWIRE) -- ALX Oncology Holdings Inc., (\342\200\234ALX Oncology\342\200\235 or \342\200\234the Company\342\200\235) (Nasdaq: ALXO), an immuno-oncology company developing therapies that block the CD47 immune checkpoint pathway, today announced the appointment of Allison Dillon, Ph.D., as Chief Business Officer (\342\200\234CBO\342\200\235).\n\342\200\234We are excited to welcome Allison to our leadership team in the midst of this promising growth period for our Company,\342\200\235 said Jason Lettmann, Chief Executive Officer of ALX Oncology. \342\200\234For over 15 years, Allison has worked to develop and deliver novel oncology products to patients with cancer. With multiple clinical study readouts over the next 12 months, Allison\342\200\231s deep oncology market expertise and impressive track record in executing portfolio, development, and commercial strategy will be vital in our endeavor to propel evorpacept to its full potential as a first-in-class, universal combination agent with anti-cancer antibodies, antibody-drug conjugates, and checkpoint inhibitors.\342\200\235\n\342\200\234Evorpacept has immense potential to positively impact the lives of people with cancer,\342\200\235 said Dr. Dillon, CBO of ALX Oncology. \342\200\234With near-term clinical trial readouts and a strong balance sheet, ALX Oncology is well positioned for greater success. I am thrilled to begin working with this impressive team as we continue elevating our science and value through this exciting next chapter.\342\200\235\nDr. Dillon joined ALX Oncology from Calithera Biosciences, where she most recently served as Senior Vice President"" of Commercial and Portfolio Strategy until 2023. During her time at Calithera, Dr. Dillon spearheaded commercial planning across a pipeline of hematology, solid tumors, and cystic fibrosis molecules. As Senior Vice President, Dr. Dillon also led corporate communications, including public and investor relations functions. Dr. Dillon helped oversee successful fundraising activities and acquisition of drugs such as mivavotinib and sapansertib from Takeda. Prior to joining Calithera in 2017, Dr. Dillon\342\200\231s expertise on pre- and post-launch commercialization strategy grew during her time at Genentech. Dr. Dillon drove the commercial launch plan for the initial launch of TECENTRIQ\302\256 (atezolizumab) in the US, and multiple subsequent launches, later serving as the Marketing Lead for GU indications. Additionally, she was the U.S. commercial representative on various Roche global business teams that informed investments. She served in marketing and sales roles for AVASTIN\302\256 (bevacizumab), TARCEVA\302\256 (erlotinib), ZELBORAF\302\256 (vemurafenib), and TECENTRIQ. Prior to Genentech, Dr. Dillon was a Senior Consultant at the management consulting firm Campbell Alliance, working across pharma and biotech clients. Prior to consulting, she was a Postdoctoral Fellow at the University of California San Francisco, Howard Hughes Medical Institute studying genetic pathways involved in medulloblastoma. Dr. Dillon holds a Ph.D. and M.S. in Neuroscience from Albert Einstein College of Medicine and a B.A. in Psychology from the University of Richmond.\nAbout ALX Oncology\nALX Oncology is a publicly traded, clinical-stage immuno-oncology company focused on helping patients fight cancer by developing therapies that block the CD47 immune checkpoint inhibitor and bridge the innate and adaptive immune system. ALX Oncology\342\200\231s lead product candidate, evorpacept, is a next generation CD47 blocking therapeutic that combines a high-affinity CD47 binding domain with a""n inactivated, proprietary Fc domain. To date, evorpacept has been dosed in over 500 subjects and has demonstrated promising activity and favorable tolerability profile across a range of hematologic and solid malignancies in combination with various leading anti-cancer antibodies. ALX Oncology is currently focusing on combining evorpacept with anti-cancer antibodies, antibody-drug conjugates (\342\200\234ADCs\342\200\235), and PD-1/PD-L1 immune checkpoint inhibitors.\nCautionary Note Regarding Forward-Looking Statements\nThis press release contains forward-looking statements that involve substantial risks and uncertainties. Forward-looking statements include statements regarding future results of operations and financial position, business strategy, product candidates, planned preclinical studies and clinical trials, results of clinical trials, research and development costs, regulatory approvals, timing and likelihood of success, plans and objects of management for future operations, as well as statements regarding industry trends. Such forward-looking statements are based on ALX Oncology\342\200\231s beliefs and assumptions and on information currently available to it on the date of this press release. Forward-looking statements may involve known and unknown risks, uncertainties and other factors that may cause ALX Oncology\342\200\231s actual results, performance or achievements to be materially different from those expressed or implied by the forward-looking statements. These and other risks are described more fully in ALX Oncology\342\200\231s filings with the Securities and Exchange Commission (\342\200\234SEC\342\200\235), including ALX Oncology\342\200\231s Annual Reports on Form 10-K, Quarterly Reports on Form 10-Q and other documents ALX Oncology files with the SEC from time to time. Except to the extent required by law, ALX Oncology undertakes no obligation to update such statements to reflect events that occur or circumstances that exist after the date o""n which they were made.\nFirst quarter revenue of $85.8 million, up 21% year-over-year\nARR of $354.2 million, up 21% year-over-year\nFirst quarter net cash provided by operating activities of $14.8 million\nFirst quarter free cash flow of $12.0 million, free cash flow margin of 14.0%\nNew Enterprise SEO Platform now Generally Available (GA)\nMay 06, 2024 04:30 PM Eastern Daylight Time\nBOSTON--(BUSINESS WIRE)--Semrush Holdings, Inc. (NYSE: SEMR), a leading online visibility management SaaS platform, today reported financial results for the first quarter ended March 31, 2024.\n\342\200\234We had a strong start to 2024, achieving first quarter revenue and ARR growth of 21% year-over-year. Importantly, we reported strong profitability exceeding our guidance, with income from operations of $1.5 million and non-GAAP income from operations of $9.7 million. In the first quarter, we reported nearly 112,000 paying customers and added several new products and features to our platform. Looking ahead, we are very optimistic about our potential. We continue to succeed in executing on our core growth pillars by onboarding more customers, cross-selling and up-selling to existing customers and leveraging AI in our platform to ensure businesses of any size have the most valuable digital marketing software suite. And now with our Enterprise SEO product generally available, we expect to drive momentum by moving up-market to larger accounts,\342\200\235 said Oleg Shchegolev, CEO and Co-Founder of Semrush.\nFirst Quarter 2024 Financial Highlights\nFirst quarter revenue of $85.8 million, up 21% year-over-year.\nIncome from operations of $1.5 million for the first quarter, compared to a loss from operations of $10.8 million in the prior year period.\nOperating margin of 1.7% for the first quarter, compared to operating margin of (15.2)% in the prior year period.\nNon-GAAP income from operations of $9.7 million for the first quarter, compared to a non-GAAP loss from operations of $6.5 mil""lion in the prior year period.\nNon-GAAP operating margin of 11.3% for the first quarter, compared to non-GAAP operating margin of (9.1)% in the prior year period.\nQ1 free cash flow of $12.0 million and free cash flow margin of 14.0%.\nARR of $354.2 million as of March 31, 2024, up 21% year-over-year.\nNearly 112,000 paying customers as of March 31, 2024, up 10% from a year ago.\nDollar-based net revenue retention of 107% as of March 31, 2024, consistent with the previous quarter.\nSee \342\200\234Non-GAAP Financial Measures & Definitions of Key Metrics\342\200\235 below for how Semrush defines ARR, dollar-based net revenue retention, non-GAAP income (loss) from operations, non-GAAP operating margin, free cash flow, and free cash flow margin, and the financial tables that accompany this release for reconciliations of each non-GAAP financial measure to its closest comparable GAAP financial measure.\nFirst Quarter 2024 Business Highlights\nWe are committed to empowering our customers with the best-in-class platform needed to boost their online presence and gain an edge in the market. In the first quarter, we advanced and expanded many of our offerings:\nContinued investments in Generative AI to provide enhanced, more efficient content creation capabilities through Semrush\342\200\231s platform and App Center:\nIntroduced Semrush Copilot, a feature that provides AI-powered SEO alerts and recommendations based on machine learning algorithms that reference data from several Semrush tools at once.\nLaunched AdCreative.ai, an AI-powered app that generates ad creatives, product photoshoots, and texts for any social media or display platform.\nWe are pleased to announce our new Enterprise SEO Platform is now generally available following a soft launch in October 2023. We see strong demand for the product and it is now being used by large, multinational corporations.\nWe have upgraded .Trends, one of our Competitive Intelligence (CI) products with daily and weekly competitor"" website traffic data. Previously the data was tracked monthly. We believe the added granularity will help businesses gain deeper insights on their competitors\342\200\231 content performance, shifts in strategy, website and individual page traffic, special events, and seasonal variations.\nSemrush customers who pay more than $10,000 annually grew by 32% year-over-year.\nEnded the quarter with more than 1,125,000 registered free active customers, up 27% year-over-year.\nBusiness Outlook\n\342\200\234We delivered a strong first quarter across the board, exceeding our revenue and Non-GAAP operating margin guidance,\342\200\235 said Brian Mulroy, CFO of Semrush. \342\200\234Growth this quarter was driven by new customer additions and expansion of our average revenue per customer as we continue to execute on our cross-sell and up-sell strategy. We continue to drive cost efficiencies, invest in the business, and expand profitability. Looking ahead, we are raising our full year 2024 guidance and are confident in our ability to grow and scale our business. We expect to make incremental investments to strengthen our position while also driving further operating leverage in the business and delivering long-term value to our shareholders.\342\200\235\nBased on information as of today, May 6, 2024, we are issuing the following financial guidance:\nSecond Quarter 2024 Financial Outlook\nFor the second quarter, we expect revenue in a range of $89.1 to $90.1 million, which at the mid-point would represent growth of approximately 20% year-over-year.\nWe expect second quarter non-GAAP operating margin to be approximately 11.0%.\nFull-Year 2024 Financial Outlook\nFor the full year, we expect revenue in a range of $366 to $369 million, which represents growth of 19% to 20% year-over-year.\nWe expect full year non-GAAP operating margin of 10.5% to 11.5%.\nWe expect full year free cash flow margin to be approximately 8.0%.\nAs indicated in our fourth quarter 2023 and full year 2023 Fin""ancial Results, we are no longer providing guidance for non-GAAP net income, and instead are guiding both non-GAAP operating margin and free cash flow margin. We have also updated our definitions of non-GAAP income (loss) from operations to exclude Amortization of Acquired Intangible Assets, Acquisition Related Costs, Restructuring Costs and other one-time expenses outside the ordinary course of business (for example, our Exit Costs incurred primarily in 2022) in addition to the prior exclusion of Stock Based Compensation. Our guidance for the second quarter 2024 and full year 2024, as well as actual results presented herein, reflect this change.\nReconciliations of non-GAAP operating margin and free cash flow margin guidance to the most directly comparable GAAP measures are not available without unreasonable efforts on a forward-looking basis due to the high variability, complexity and low visibility with respect to the charges excluded from these non-GAAP measures, in particular the measures and effects of share-based compensation expense, employer taxes and tax deductions specific to equity compensation awards that are directly impacted by future hiring, turnover and retention needs. We expect the variability of the above charges to have a significant, and potentially unpredictable, impact on our future GAAP financial results.\nConference Call Details\nSemrush will host a conference call and webcast to discuss its financial results, business highlights, outlook and other matters, the details for which are provided below.\nDate: Tuesday, May 7, 2024\nTime: 8:30 a.m. ET\nHosts: Oleg Shchegolev, CEO, Eugene Levin, President, and Brian Mulroy, CFO\nConference ID: 283299\nParticipant Toll Free Dial-In Number: +1 833 470 1428\nParticipant International Dial-In Number: +1 929 526 1599\nRegistration:\nThe live webcast of the conference call as well as the replay can be accessed for a limited time from the Semrush investor relations website at http://investors.semrush.com""/.\nAbout Semrush\nSemrush is a leading online visibility management SaaS platform that enables businesses globally to run search engine optimization, pay-per-click, content, social media and competitive research campaigns and get measurable results from online marketing. Semrush offers insights and solutions for companies to build, manage, and measure campaigns across various marketing channels. Semrush, with nearly 112,000 paying customers, is headquartered in Boston and has offices in Philadelphia, Trevose, Austin, Dallas, Florida, Amsterdam, Barcelona, Belgrade, Berlin, Limassol, Prague, Warsaw, and Yerevan.\nForward-looking Statements\nThis press release contains forward-looking statements within the meaning of the federal securities laws, which are statements that involve substantial risks and uncertainties. Forward-looking statements generally relate to future events or our future financial or operating performance. In some cases, you can identify forward-looking statements because they contain words such as \342\200\234may,\342\200\235 \342\200\234will,\342\200\235 \342\200\234shall,\342\200\235 \342\200\234should,\342\200\235 \342\200\234expects,\342\200\235 \342\200\234plans,\342\200\235 \342\200\234anticipates,\342\200\235 \342\200\234could,\342\200\235 \342\200\234intends,\342\200\235 \342\200\234target,\342\200\235 \342\200\234projects,\342\200\235 \342\200\234contemplates,\342\200\235 \342\200\234believes,\342\200\235 \342\200\234estimates,\342\200\235 \342\200\234predicts,\342\200\235 \342\200\234potential\342\200\235 or \342\200\234continue\342\200\235 or the negative of these words or other similar terms or expressions that concern our expectations, strategy, plans or intentions. Forward-looking statements include, but are not limited to, guidance on financial results for the second quarter and full year of 2024 (including revenue, non-GAAP operating margin, and free cash flow margin); statements regarding the expectations of demand for our products"", including the .Trends product, onboarding new customers, adoption of and demand for new products and features; statements about expansion of our platform, and launching new products; statements about future operating results, growth opportunities, future spending and incremental investments, business trends, capability to deliver profits, and growth and value for shareholders.\nThe forward-looking statements contained in this release are also subject to other risks and uncertainties, including those more fully described in our filings with the Securities and Exchange Commission (\342\200\234SEC\342\200\235), including in the sections entitled \342\200\234Risk Factors\342\200\235 and \342\200\234Management\342\200\231s Discussion and Analysis of Financial Condition and Results of Operations'' in our filings with the Securities and Exchange Commission (\"SEC\"), including our most recent annual report on form 10-K, and our subsequently filed quarterly reports and other SEC filings. Although we believe that our plans, intentions, expectations, strategies and prospects as reflected in or suggested by those forward-looking statements are reasonable, we can give no assurance that the plans, intentions, expectations or strategies will be attained or achieved. The forward-looking statements in this release are based on information available to us as of the date hereof, and we disclaim any obligation to update any forward-looking statements, except as required by law. These forward-looking statements should not be relied upon as representing our views as of any date subsequent to the date of this press release.\nAdditional information regarding these and other factors that could affect our results is included in our SEC filings, which may be obtained by visiting our Investor Relations page on its website at investors.semrush.com or the SEC's website at www.sec.gov.\nNon-GAAP Financial Measures & Definitions of Key Metrics\nWe believe that providing non-GAAP information to ""investors, in addition to the GAAP presentation, allows investors to view the financial results in the way management views the operating results. We further believe that providing this information allows investors to not only better understand our financial performance, but also to evaluate the efficacy of the methodology and information used by management to evaluate and measure such performance. We also believe that the use of non-GAAP financial measures provides an additional tool for investors to use in evaluating ongoing operating results and trends and in comparing our financial results with other companies in our industry, many of which present similar non-GAAP financial measures to investors. We also believe free cash flow margin is useful to investors as we monitor it as a measure of our overall business performance, which enables us to analyze our future performance without the effects of non-cash items and allows us to better understand the cash needs of our business. The non-GAAP information included in this press release should not be considered superior to, or a substitute for, financial statements prepared in accordance with GAAP and may be different from non-GAAP financial measures presented by other companies. Investors are encouraged to review the reconciliation of non-GAAP measures to their most directly comparable GAAP financial measures provided in the financial statement tables included below in this press release.\nAnnual Recurring Revenue (ARR) is defined as of a given date as the monthly recurring revenue that we expect to contractually receive from all paid subscription agreements that are actively generating revenue as of that date multiplied by 12. We include both monthly recurring paid subscriptions, which renew automatically unless canceled, as well as the annual recurring paid subscriptions so long as we do not have any indication that a customer has canceled or intends to cancel its subscription and we continue to generate revenue fr""om them.\nDollar-based net revenue retention is defined as (a) the revenue from our customers during the twelve-month period ending one year prior to such period as the denominator and (b) the revenue from those same customers during the twelve months ending as of the end of such period as the numerator. This calculation excludes revenue from new customers and any non-recurring revenue.\nFree cash flow and free cash flow margin. We define free cash flow, a non-GAAP financial measure, as net cash provided by (used in) operating activities less purchases of property and equipment and capitalized software development costs. We define free cash flow margin as free cash flow divided by GAAP revenue.\nNon-GAAP income (loss) from operations, and non-GAAP operating margin. As described above, we have updated our definitions for non-GAAP income (loss) from operations and have introduced non-GAAP operating margin; the updated definitions, which apply to our guidance for the second quarter and full year 2024, are as follows. We define non-GAAP income (loss) from operations as GAAP income (loss) from operations, excluding Stock Based Compensation, Amortization of Acquired Intangible Assets, Acquisition Related Costs, Restructuring Costs and other one-time expenses outside the ordinary course of business (for example, our Exit Costs incurred primarily in 2022). We define non-GAAP operating margin as non-GAAP income (loss) from operations divided by GAAP revenue. We believe investors may want to consider our results with and without the effects of these items in order to compare our financial performance with that of other companies that exclude such items and to compare our results to prior periods.\nStock-based compensation. Stock-based compensation is a non-cash expense accounted for in accordance with FASB ASC Topic 718. We believe that the exclusion of stock-based compensation expense allows for financial results that are more indicative of our operational performance and pr""ovide for a useful comparison of our operating results to prior periods and to our peer companies because stock-based compensation expense varies from period to period and company to company due to such things as differing valuation methodologies, timing of awards and changes in stock price.\nAmortization of acquired intangible assets. Excluding amortization of acquired intangible assets from non-GAAP expense and income measures allows management and investors to evaluate results \342\200\234as-if\342\200\235 the acquired intangible assets had been developed internally rather than acquired and, therefore, provides a supplemental measure of performance in which our acquired intellectual property is treated in a comparable manner to our internally developed intellectual property. These amounts are inconsistent in amount and frequency and are significantly impacted by the timing and size of acquisitions. Although we exclude amortization of acquired intangible assets from our non-GAAP expenses, we believe that it is important for investors to understand that such intangible assets contribute to revenue generation.\nRestructuring and other costs. Restructuring and other costs include restructuring expenses as well as other charges that are unusual in nature, are the result of unplanned events, and arise outside the ordinary course of our business. Restructuring expenses consist of employee severance costs, charges for the closure of excess facilities and other contract termination costs. Other costs include litigation contingency reserves, asset impairment charges, relocation expenses associated with the migration of employees in 2022 that occurred throughout 2022 and early 2023, and gains or losses on the sale or disposition of certain non-strategic assets or product lines.\nAcquisition-related costs, net. In recent years, we have completed a number of acquisitions, which result in transition, integration and other acquisition-related expense which would not otherwise h""ave been incurred, are unpredictable and dependent on a significant number of factors that are deal-specific or outside of our control, are not indicative of our operational performance (or that of the acquired businesses or assets) and are likely to fluctuate as our acquisition activity increases or decreases in future periods. By excluding acquisition-related costs and adjustments from our non-GAAP measures, management is better able to evaluate our ability to utilize our existing assets and estimate the long-term value that acquired assets will generate for us.\n\nEARNINGS\nAddus HomeCare Expects 2024 Acquisitions\nBy Jim Parker | May 7, 2024\n Pixabay\nShare\nFacebook\nTwitter\nLinkedIn\nSend email\nAddus HomeCare Corp. (NASDAQ: ADUS) is poised for further acquisitions, potentially including some hospice deals.\nThe company is seeking to pair its clinical services with its personal business in its existing markets. This is a cornerstone of its acquisition strategy. But Addus Chairman and CEO Dirk Allison does not rule out the possibility of moving into new markets if circumstances are right.\n\342\200\234As we see potential acquisitions come to mark, it remains our primary focus to use our financial capacity to acquire strategic operations that align with our overall growth strategy of adding clinical services where we have strong personal care presence, enhancing our existing personal care markets and adding new personal care markets where we can enter at scale,\342\200\235 Allison said in a Q1 earnings call. \342\200\234We also believe this acquisition strategy will continue to strengthen our ability to participate in value-based contracts with our payers and to adapt to potential reimbursement changes.\342\200\235\nWhen examining new markets, Addus focuses on regions where they can quickly become the largest or second-largest provider by market share, according to CFO Brian Poff.\nFueling its acquisition aspirations is more than $77 million in dry powder as w""ell as existing lines of credit.\nAddus\342\200\231 roughly 33,000 employees provide hospice, home health and private duty nursing services across more than 200 locations in 22 states.\nThe company saw 11.6% year-over-year revenue growth in Q1, reaching $280.7 million in net service revenue. The company\342\200\231s hospice segment, which represents about 20% of the business, earned nearly $56 million in the first quarter. Hospice revenue per day was up 3.7% from the prior year\342\200\231s quarter.\nThe personal care, hospice and home health provider is no stranger to acquisitions. Addus purchased Illinois-based hospice provider JourneyCare Inc. for $85 million in October 2022 and picked up Chicago-based  Home Health Ltd. for an undisclosed sum the following month. Last summer, Addus acquired Tennessee Quality Care for $106 million.\nIn addition to deals, Addus is seeing results when it comes to same-store hospice growth.\n\342\200\234We were pleased to see consistent positive year over year trends in our hospice business in the first quarter inclusive of our Tennessee Quality Care acquisition. Our hospice same-store revenue growth of 5.8% was our third consecutive quarter of sequential increase and the highest percentage increase we have seen prior to the COVID pandemic,\342\200\235 Poff said during the earnings call. \342\200\234We continue to see favorable admission trends as we have experienced three consecutive quarters of sequential same store admission growth.\342\200\235\n\n\n\n";
